@johnkingbooksdetroit  has an estimated 1 million books in stock, with a large collection of rare and used titles. The store was established in Dearborn Michigan in 1965. In 1971 it was moved to the Michigan theater in downtown Detroit. In 1983 John King purchased the abandoned glove factory, which has since housed the stores collection. Later two smaller stores opened in Ferndale and the big bookstore in the Caz, Corinne neighborhood, adjacent to Wayne State University. 
